package Operators;
//Arithemetic
public class ArithemeticOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10;
		int c=12;
		int h=90;
		int b=a+c+h;
		int d=a-b;
		int e=b*d;
		System.out.println(d);
		System.out.println(e);
	
		System.out.println(b);

	}

}
